import React, { Component } from 'react';
import './App.css';
import callOfDuty from './components/Games/callOfDuty.jpg';


class App extends Component {
  render() {
    return (
      <div className="games">
        <img src={callOfDuty} alt="" className="game" />
      </div>
    )
  }

}

export default App;
